import React, {Component} from 'react';
import './Home.css';
import logo from '../pics/logo.png'

class Home extends Component {
  render() {
    return (
      <div> 
        <div className="title">
          <span>DA</span> 
          <img src={logo} id="logo"/>
          <span>LC</span>
        </div>
      </div>
    );
  }
}

export default Home;
